    function push() public{

        arr1.push(true);

        arr1.push(false);

    }
    function length()public view returns(uint){
        return arr1.length;
    }


struct data{

        string name;

        uint age;

    }
// name of the constructor should be added if we use brackets to assign values 
    data public d = data("Ahmed", 23);
}

